import { getExamCardList } from "../../api/exam";
export default {
  name: 'ExamCardList',
  data: function data() {
    return {
      description: '您可以随意点击下面的考试卡片开始一场属于您的考试',
      extraImage: 'https://gw.alipayobjects.com/zos/rmsportal/RzwpdLnhmvDJToTdfDPe.png',
      dataSource: []
    };
  },
  methods: {
    joinExam: function joinExam(id) {
      var routeUrl = this.$router.resolve({
        path: "/exam/".concat(id)
      });
      window.open(routeUrl.href, '_blank');
    }
  },
  mounted: function mounted() {
    var _this = this;
    // 从后端数据获取考试列表，适配前端卡片
    getExamCardList().then(function (res) {
      console.log(res);
      if (res.code === 0) {
        _this.dataSource = res.data;
      } else {
        _this.$notification.error({
          message: '获取考试列表失败',
          description: res.msg
        });
      }
    }).catch(function (err) {
      // 失败就弹出警告消息
      _this.$notification.error({
        message: '获取考试列表失败',
        description: err.message
      });
    });
  }
};
